--
-- Name: next_episodes; Type: VIEW; Schema: public; Owner: teevy
--

CREATE VIEW next_episodes AS
    SELECT episodes.id, lag(episodes.id) OVER (PARTITION BY (episodes.id).show_id ORDER BY (episodes.id).season_nr DESC, (episodes.id).episode_nr DESC) AS next_id, episodes.release_date FROM episodes ORDER BY (episodes.id).season_nr, (episodes.id).episode_nr;


ALTER TABLE public.next_episodes OWNER TO teevy;

